import React from 'react';
import Countdown from 'react-countdown';
import './Timer.css';

class Timer extends React.Component {
  Completionist() {
    <span>You are good to go!</span>;
  }
  render() {
    return (
      <Countdown date={Date.now() + 5000}>
        <Completionist />
      </Countdown>
    );
  }
}

export default Timer;
